import './App.css';
import {BrowserRouter as Router,Routes,Route} from "react-router-dom";
import Header from './components/header/Header';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route index element={<Header/>}></Route>
          <Route path='/movie/:id' element={<h1>all movies displayed here</h1>}></Route>
          <Route path='/movies/:type' element={<h1>alllll movies types displayed here</h1>}></Route>
          <Route path='/*' element={<h1>error</h1>}></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
